import React from 'react'
import styled from 'styled-components'
import { Container } from 'tsparticles'

const MainContainer=styled.div`
background:${props=>props.theme.body};
width:100vw;
height:100vh;
overflow:hidden;

position: relative;

h2,h3,h4,h5,h5{
  font-family: 'Karla',sans-serif;
  font-weight:500;
}
`

const Main = () => {
  return (
    <MainContainer>
      <Container>
        Main Component/Page
      </Container>
    </MainContainer>
  )
}

export default Main
